import './App.css';
import React from 'react';

class Professores extends React.Component
{
  readProfs()
  {
    fetch('https://sigaa.ifsc.edu.br/sigaa/public/curso/lista.jsf', {method: 'get', mode: 'no-cors'})
      .then(response => {
        if (response.ok)
        {
          return response;
        }
      });


    //console.log(response);
    //return [ { id:1,name:'Arliones'}, {id: 2, name:'Odilson'}];
    //return response;
  }
  render()
  {
    var profs = this.readProfs();

    return (
      <div>
        <h1>Professores</h1>
        <ol>
          {profs.map((prof) => (
            <li key={prof.id}>{prof.name}</li>
          ))}
        </ol>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
